function removePropertyFromLocalStorage(id,formSubmit=0){id=parseInt(id);if(localStorage.activity){var activity=JSON.parse(localStorage.getItem("activity"));if(activity.email_basket){activity.email_basket.forEach(function(item,index,object){if(item.id==id){object.splice(index,1);}});if(activity.email_basket.length<1){hideEmailBasket();$('.email-basket-footer').addClass('dis-none');if(formSubmit==0){$('.popup_close').trigger('click');}}else{$('.email-basket-footer').removeClass('dis-none');}
localStorage.removeItem('activity');localStorage.setItem('activity',JSON.stringify(activity));basketCounter();}}}
function removePropertyFromEmailBasket(id){$('.property-basket-'+id).remove();$('#'+'prop-item-checkbox-'+id).prop('checked',false);removePropertyFromLocalStorage(id);}
function removeAllItemsFromLocalStorageEmailBasket(){if(localStorage.activity){var activity=JSON.parse(localStorage.getItem("activity"));if(activity.email_basket){activity.email_basket=[];localStorage.removeItem('activity');localStorage.setItem('activity',JSON.stringify(activity));hideEmailBasket();}}}
